    val pagingImageListLiveData: LiveEvent<ArrayList<String>> by lazy {
        LiveEvent()
    }

    val infinitieImageListLiveData: LiveEvent<ArrayList<String>> by lazy {
        LiveEvent()
    }

    fun getImageListApiOrDB() {
        // This is just for example and this must handle with Coroutines and get Data from Repository
        Handler(Looper.getMainLooper()).postDelayed({
            infinitieImageListLiveData.postValue(fakeData)
        }, 700)
    }

    fun getImageListApiOrDB(page: Int) {
        // This is just for example and this must handle with Coroutines and get Data from Repository
        Handler(Looper.getMainLooper()).postDelayed({
            val startIndex = page * pageSize
            val endIndex = ((page + 1) * pageSize) - 1
            pagingImageListLiveData.postValue(
                ArrayList(
                    try {
                        fakeData.subList(
                            startIndex,
                            if (fakeData.size < endIndex) fakeData.size else endIndex
                        )
                    } catch (e: Exception) {
                        arrayListOf<String>()
                    }
                )
            )
        }, 700)
    }


}